  `volunteerEnd` timestamp NULL DEFAULT NULL COMMENT '发心结束时间,不填为无限期发心',
  `specialty` varchar(255) DEFAULT NULL COMMENT '专业技能及特长 - tbSkillsSpecialty 从这里取关键字',
  PRIMARY KEY (`id`,`code`)
) ENGINE=InnoDB AUTO_INCREMENT=309 DEFAULT CHARSET=utf8 COMMENT='员工表';
